class Solution {
public:
    int findMinArrowShots(vector>& points) {
        sort(points.begin(),points.end(),[](vector& a,vector& b){
            return a[0]& prev = points[0];
        int count = 1;
        for(int i=1;iprev[1])//没有重叠，将当前气球作为公共区域
            {
                ++count;
                prev = points[i];
            }
            else//有重叠，更新公共区域
            {
                prev[0] = points[i][0];
                prev[1] = min(prev[1],points[i][1]);
            }
        }
        return count;
    }
};



