void merge(vector& nums1, int m, vector& nums2, int n) {
    int pos = m-- + n-- - 1;//++a速度更快
    while (m >= 0 && n >= 0) {//nums1被延长至m+n，多出的n位被0填补，题目要求把第二个数组归并到第一个数组上
        nums1[pos--] = nums1[m] > nums2[n]? nums1[m--]: nums2[n--];//取较大值放num1尾部
    }
    while (n >= 0) {//num1先处理完，继续处理num2
        nums1[pos--] = nums2[n--];
    }
}



