leetcode 142（环形链表头）

floyd判圈法
ListNode *detectCycle(ListNode *head) {
    ListNode *slow = head, *fast = head;
    // 判断是否存在环路
    do {
        if (!fast || !fast->next) return nullptr;//fast有尽头，没有环路
        fast = fast->next->next;//fast两步
        slow = slow->next;//slow一步
    } while (fast != slow);//第一次相遇
    // 如果存在，查找环路节点
    fast = head;//fast回到链表头
    while (fast != slow){
        slow = slow->next;
        fast = fast->next;
    }//第二次相遇
    return fast;
}



