4.3查找区间
leetcode 34（升序找目标值始终）

// 主函数
vector searchRange(vector& nums, int target) {
    if (nums.empty()) return vector{-1, -1};
    int lower = lower_bound(nums, target);
    int upper = upper_bound(nums, target) - 1; // 这里需要减1位，upper_bound没有取等
    if (lower == nums.size() || nums[lower] != target) {//有可能找的是大于target的值
        return vector{-1, -1};
    }
    return vector{lower, upper};
}
// 辅函数
int lower_bound(vector &nums, int target) {
    int l = 0, r = nums.size(), mid;
    while (l = target) {//中间值在右侧，更新右侧索引
            r = mid;
        } else {//在左侧，更新左侧索引
            l = mid + 1;
        }
    }
    return l;
}
// 辅函数
int upper_bound(vector &nums, int target) {
    int l = 0, r = nums.size(), mid;
    while (l  target) {//同上，没有取等
            r = mid;
        } else {
            l = mid + 1;
        }
    }
    return l;
}



