            perm.emplace_back(nums[i]);//修改
            vis[i] = 1;
            backtrack(nums, ans, idx + 1, perm);//递归
            vis[i] = 0;//回改
            perm.pop_back();
        }
    }

    vector> permuteUnique(vector& nums) {
        vector> ans;
        vector perm;
        vis.resize(nums.size());
        sort(nums.begin(), nums.end());//排序，方便判断重复数字
        backtrack(nums, ans, 0, perm);
        return ans;
    }
};



