    public:
    Solution(ListNode* n): head(n) {}
    int getRandom() {
        int ans = head->val;
        ListNode* node = head->next;
        int i = 2;
        while (node) {
            if ((rand() % i) == 0) {//1/m 的概率
                ans = node->val;
            }
            ++i;
            node = node->next;
        }
        return ans;
    }
};



