//HashTable
template 
class HashTable {
    private:
    vector> hash_table;//本质时对hash_table中的slot的操作
    // 哈希函数
    int myhash(const T & obj) const {
        return hash(obj, hash_table.size());//一种obj到hash_table的映射
    }
    public:
    // size最好是质数
    HashTable(int size=31) {
        hash_table.reserve(size);
        hash_table.resize(size);
    }
    ~HashTable() {}
    // 查找哈希表是否存在该值
    bool contains(const T & obj) {
        int hash_value = myhash(obj);
        const list & slot = hash_table[hash_value];//找到hash值的槽，对用一个list
        std::list::const_iterator it = slot.cbegin();//指向表头的迭代器
        for (; it != slot.cend() && *it != obj; ++it);
        return it != slot.cend();
    }
    // 插入值
    bool insert(const T & obj) {
        if (contains(obj)) {
            return false;
        }
        int hash_value = myhash(obj);
        std::list & slot = hash_table[hash_value];
        slot.push_front(obj);
        return true;
    }
    // 删除值
    bool remove(const T & obj) {
        list & slot = hash_table[myhash(obj)];
        auto it = find(slot.begin(), slot.end(), obj);
        if (it == slot.end()) {
            return false;
        }
        slot.erase(it);
        return true;
    }
};
