    while (!hash.empty()) {//遍历hash
        int cur = *(hash.begin());//以当前元素为起点向前（后）搜索连续元素
        hash.erase(cur);
        int next = cur + 1, prev = cur - 1;
        while (hash.count(next)){//向后
            hash.erase(next++);
        }
        while (hash.count(prev)) {//向前
            hash.erase(prev--);
        }
        ans = max(ans, next - prev - 1);//计算最长连续元素长度
    }
    return ans;
}



