template 
    class BST {
        struct Node {
            T data;
            Node* left;
            Node* right;
        };
        Node* root;
        Node* makeEmpty(Node* t) {
            if (t == NULL) return NULL;
            makeEmpty(t->left);
            makeEmpty(t->right);
            delete t;
            return NULL;
        }
        Node* insert(Node* t, T x) {
            if (t == NULL) {//最底层一定有一个节点可以插入，最左侧为最小值，最右侧为最大值中间递增，所以一般为不完全树
                t = new Node;
                t->data = x;
                t->left = t->right = NULL;
            } else if (x data) {
                t->left = insert(t->left, x);
            } else if (x > t->data) {
                t->right = insert(t->right, x);
            }
            return t;
        }
        Node* find(Node* t, T x) {
            if (t == NULL) return NULL;
            if (x data) return find(t->left, x);
            if (x > t->data) return find(t->right, x);
            return t;
        }
        Node* findMin(Node* t) {
            if (t == NULL || t->left == NULL) return t;//if (t->left == NULL) return t;
            return findMin(t->left);
        }
        Node* findMax(Node* t) {
            if (t == NULL || t->right == NULL) return t;
            return findMax(t->right);
        }
        Node* remove(Node* t, T x) {//牛逼的递归
            Node* temp;
            if (t == NULL) return NULL;
            else if (x data) t->left = remove(t->left, x);//比根节点小，寻找左子树
            else if (x > t->data) t->right = remove(t->right, x);//比根节点大，寻找右子树
            else if (t->left && t->right) {//找到且两个子节点都不空，将该节点替换为右子树最小值
                temp = findMin(t->right);
                t->data = temp->data;//通过修改值的方法，修改节点
                t->right = remove(t->right, t->data);//将重复的值删除
            } else {//找到且有一个子节点为空，直接将子节点上移
                temp = t;
                if (t->left == NULL) t = t->right;//通过修改指针的方法，删除节点
                else if (t->right == NULL) t = t->left;
                delete temp;
            }
            return t;
        }
        public:
        BST(): root(NULL) {}
        ~BST() {
            root = makeEmpty(root);
        }
        void insert(T x) {
            insert(root, x);
        }
        void remove(T x) {
            remove(root, x);
        }
    };



