class Solution {
    int post_idx;
    unordered_map idx_map;
public:
    TreeNode* helper(int in_left, int in_right, vector& inorder, vector& postorder){
        // 如果这里没有节点构造二叉树了，就结束
        if (in_left > in_right) {
            return nullptr;
        }

        // 选择 post_idx 位置的元素作为当前子树根节点
        int root_val = postorder[post_idx];
        TreeNode* root = new TreeNode(root_val);

