class Solution {
public:
    ListNode* getMedian(ListNode* left, ListNode* right) {
        ListNode* fast = left;
        ListNode* slow = left;
        while (fast != right && fast->next != right) {
            fast = fast->next;
            fast = fast->next;
            slow = slow->next;
        }
        return slow;
    }

    TreeNode* buildTree(ListNode* left, ListNode* right) {
        if (left == right) {
            return nullptr;
        }
        ListNode* mid = getMedian(left, right);//得到根节点
        TreeNode* root = new TreeNode(mid->val);
        root->left = buildTree(left, mid);//恢复左子树
        root->right = buildTree(mid->next, right);//右子树
        return root;
    }

    TreeNode* sortedListToBST(ListNode* head) {
        return buildTree(head, nullptr);
    }
};
分治+中序优化
class Solution {
public:
    int getLength(ListNode* head) {
        int ret = 0;
        for (; head != nullptr; ++ret, head = head->next);
        return ret;
    }

    TreeNode* buildTree(ListNode*& head, int left, int right) {
        if (left > right) {
            return nullptr;
        }
        int mid = (left + right + 1) / 2;
        TreeNode* root = new TreeNode();//根节点
        root->left = buildTree(head, left, mid - 1);//左
        root->val = head->val;
        head = head->next;
        root->right = buildTree(head, mid + 1, right);//右
        return root;
    }

    TreeNode* sortedListToBST(ListNode* head) {
        int length = getLength(head);//得到链表长度
        return buildTree(head, 0, length - 1);
    }
};



