class Solution {
public:
    int minimumCost(int N, vector>& connections) {
        //重载priority_queue的比较函数，priority_queue默认是大顶堆，重载的是号的判断即可，大于返回true，优先级低，被放到后面，则小的会放前面
        struct cmp {
            bool operator () (const vector &a, const vector &b) {
                return a[2] > b[2];
            }
        };
        int selected = 0, ans = 0;
        //构建点和cost的集合关系，本质是个三维数组，第一维是起点，二维是
        vector>> edgs(N+1,vector>());
        //构建小顶堆，将最合适的点放在最前面
        priority_queue,vector>,cmp> pq;
        vector visit(N+1, 0);
        //初始化边集合，无向图两边都要 
        for(auto re : connections){
            edgs[re[0]].push_back(make_pair(re[1],re[2]));
            edgs[re[1]].push_back(make_pair(re[0],re[2]));
        }
        //本次选择1为起点，如果1点没有变，则1永远是孤岛。本次选择1为起点
        if(edgs[1].size() == 0){
            return -1;
        }

        selected = 1;
        visit[1] = true;
        //起点1所在的边放入小顶堆
        for(int i = 0;i ({1,edgs[1][i].first,edgs[1][i].second}));
        }
       //遍历小顶堆
        while(!pq.empty()) {
            auto curr = pq.top();pq.pop();
            if(!visit[curr[1]]){
                visit[curr[1]] = true;
                ans += curr[2];
                 //依次取出cost最小的边所在的点加入集合
                for(auto e : edgs[curr[1]]){//发散，遍历终点连接的所有边
                    pq.push(vector({curr[1],e.first,e.second}));
                }
                selected++;
                if(selected == N){ //如果N个节点都在时，则结束循环
                    return ans;
                }
            }
        }
        return -1;
    }
};



